const img = await image.image(
  "data:image/jpeg;base64,"
);

const s = svg.svg({ width: img.width(), height: img.height() });

const height = 50;
const width = 5;
for (let y = height / 2; y < img.height(); y += height) {
  let i = 0;
  for (let x = 0; x < img.width(); x += width) {
    const c = img.get(x - width / 2, y);
    const intensity = 3 - ((c[0] + c[1] + c[2]) / (255 * 3)) * 3;
    console.log(intensity);
    const p = s
      .path({
        fill: "none",
      })
      .moveTo(x, y);
    const sign = i % 2 === 0 ? -1 : 1;
    p.qCurve(x + width / 2, y + sign * intensity * height, x + width, y);
    i += 1;
  }
}

load(s);
